function App() {
  return (
  <div>

    
    <Routes>

    <Route path='/' element={<Home/>} /> 
    <Route path='/details' element={<Details/>}/>
    <Route path='/checkout' element={<Checkout/>}/>
    </Routes>
    
  </div>
    
    );
}

export default App;
